Iris Blue is a total sweetheart. She absolutely loves everyone she meets including kids. Total lovebug. Iris gets along phenomenally with other dogs. She is more of the snuggler. 

Aida is more of the mischievous one. But is a lover also, she will give you LOTS of kisses & will make sure you love her. Aida loves playing with her sister. She also gets along phenomenally with other dogs & loves to play play play. Aida loves to play fetch. 

**Aida & Iris Blue are bonded & have to be adopted together. They would do best in a home with a fenced in yard and an active family. If you need some fun & goofiness in your life then these two are your girls. You can sit there and watch them play for hours & not get tired of watching them. Fill out an application & meet them, you won't regret it.** 

Email: dogs@almosthomefoundation.org

Almost Home Foundation's adoption requirements:
(1) Be at least 21 years of age;
(2) Have the consent of all adults living in the household;
(3) Have approval from the residence owner;
(4) Have valid ID with current address;
(5) Be approved by Almost Home Foundation as a suitable adoptive home; and
(6) Live in the suburbs surrounding Schaumburg (Illinois Residents only)
*** Please note that Almost Home Foundation accepts only cash or checks for adoption fees; we do not accept debit or credit cards. ***

